import React, { Component } from 'react';

// let orders = { date, email, item, price, vendor };
class Detail extends Component {
    state = {
        date: '',
        email: '',
        item: '',
        price: '',
        vendor: ''
    }

    componentDidMount() {

    }
    render() {
        const { email, item, price, vendor, date } = this.props.order;
        return (
            <table className="table container table-striped bg-secondary text-white detail">
                <thead>
                    <tr>
                        <th>Email:</th>
                        <th>Item:</th>
                        <th>Price:</th>
                        <th>Vendor:</th>
                        <th>Date:</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{email}</td>
                        <td>{item}</td>
                        <td>{price}</td>
                        <td>{vendor}</td>
                        <td>{date}</td>
                    </tr>
                </tbody>
            </table>
        )
    }
}

export default Detail;
